import  './GeradorNumeros.css'
interface GeradorNumerosProps{
    Numeros: number[]
    n:number;
    gerador:(numero:number)=>void;
}
function GerarNumeros(props: GeradorNumerosProps){
   const Numeros = gerador();
    return(
      <section>
         <p>${Numeros}</p>
      </section>
    )
}
export default GerarNumeros;

function gerador() {
    const Numeros = [];

    for (let i = 0; i < 25; i++)
        Numeros[i] = i + 1;

    let remover = 10;

    while (remover > 0) {
        const n = Math.random() * 25;
        if (Numeros[n] > 0) {
            remover--;
            Numeros[n] = 0;
        }
    }
    return Numeros;
}
